            StyleKit.drawMic(frame: CGRect(x: 0, y: 0, width: imageSize.width, height: imageSize.height), highlited: highlited)

        let imageOfMic = UIGraphicsGetImageFromCurrentImageContext()!.withRenderingMode(.alwaysOriginal)
        UIGraphicsEndImageContext()

        return imageOfMic
    }

